- input: "TEXT\x1CC00010033\x1CX0\x1C\x1CF3XA\x1CThis amendment is in response to
    the Commission's letter dated June 25, 2008. The payment for 'Polling Consulting
    Fees' and 'Media Consulting Fees' were for general consulting on polling and media
    strategy and were not for the benefit of any candidate for federal office.  The
    payments were made to individuals who are not employees of the Committee. Payments
    on Schedule H4 for the Mansfield Metcalf Dinner have been corrected to reflect
    the same ratio as the amended Schedule H2.  The payment for 'Fundraising Fees'
    on Schedule B for Line 21b are fees paid to a fundraising firm for their efforts
    on behalf of the Committee.  Payments for 'Food and Beverage' on Schedule H4 are
    for expenses incurred while traveling or payments for staff meals. Payments for
    Payroll and Payroll Taxes on Schedule H4 are for employees who did not spend more
    than 25% of their time during the period on activities in connection with a federal
    election.   "
